import React from 'react'

function MovieCard({movie}) {
  return (
    <div className='moviecard'>
      <div className='movieimage'>
        <img src={movie.Poster}/>
      </div>
      <div className='moviedata'>

      </div>
    </div>
  )
}

export default MovieCard
